chapterList.JSParser:
function functionName(config, params, result)
{
      if(!params.lastResponse){
         params.nativeTool.setCache(params.queryInfo.detailUrl ,JSON.stringify([]));
      }
      let tmp=params.nativeTool.getCache(params.queryInfo.detailUrl);
let lists=tmp?JSON.parse(tmp):[];
lists=lists.concat(result.list?result.list:[]);
     if(result.nextPageUrl&&params.pageIndex<result.maxPage){
      params.nativeTool.setCache(params.queryInfo.detailUrl ,JSON.stringify(lists));
     result.list=[]
     }
     else{
      result.list=lists.reverse();
    }
   return result;
}
